import React from 'react';
import './WhatsAppButton.css'; // Importe o arquivo CSS com os estilos do botão do WhatsApp
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faWhatsapp } from '@fortawesome/free-brands-svg-icons';

const WhatsAppButton = () => {
  const handleClick = () => {
    window.open('https://api.whatsapp.com/send?phone=SEU_NUMERO_DE_TELEFONE', '_blank');
  };

  return (
    <div className="whatsapp-fixed">
      <div className="animate-border">
        <a className="video-vemo-icon btn-whatsapp" aria-label="WhatsApp" href="https://api.whatsapp.com/send?phone=11996610300" target="_blank" rel="noopener noreferrer" onClick={handleClick}>
          {/* Ícone do WhatsApp */}
          <FontAwesomeIcon icon={faWhatsapp} />
        </a>
      </div>
    </div>
  );
};

export default WhatsAppButton;
